import React, {useRef} from 'react';
import './imageButton.css';

function ImageButton({imageSrc, imageHover, alt, css, type}) : any {
  let mouseOn : boolean = false;

  const onMouseOver = () => {
    mouseOn = true;
    console.log()
  }

  const onmouseLeave = () => {
    mouseOn = false;
  }

  return (
      <button className="ImageBtn" style={css} onMouseOver={onMouseOver} onMouseLeave={onmouseLeave}>
        <img src={mouseOn ? imageSrc : imageHover} alt={alt} />
      </button>
  );
}

export default ImageButton;
